W.A. Leary, Jr., who first &quot;peddled books in a basket; then he afterwards had a very small book stand ... He persevered, and in a short time rented the store on the southeast corner of Fifth and Walnut streets. His business increased, and he soon became an active old bookseller. He was a mere vender of books; he neither knew their contents nor cared to know.&quot;

Penn Libraries call number: GC5 F8476 534p 1690

