Frederick Nicolay (1728-1809), librarian for the Royal Music Library in London, collector and owner of a personal library, which was published in 1809 under the name &quot;A catalogue of the very elegant library of the late Fred. Nicolay.&quot;

Penn Libraries call number: IC5 L9687 554l

